    console.log(props)
    return (
        <header>
            <div className="title-container">
                <h1 className="recipe-title">{}</h1>
            </div>
            <div className="recipe-controls-primary">
                <button className="btn-warning" onClick={() => {props.deleteRecipe(props.recipe.id) && props.history.replace('/')}}>Delete Recipe</button>
            </div>
        </header>
    )
}

export default withRouter(RecipeHeader)
